I really did enjoy work yesterday, grant it that I almost tossed my cookies and had a killer heat headache, I had a pretty good time. I worked a ten hour day, on a rock wall, moon bounce, bungee run, and a barrel roll thing... Mel randomly stopped by, she caught me right when I was getting sick. It was...&nbsp; 

Last night I went with some other peeps to see Rush Hour 3, it was pretty much amazing..

One last week.
